        public ActionResult Index(string id = null)
        {
            if (!string.IsNullOrEmpty(id))
            {
                string incoming = id.Replace('_', '/').Replace('-', '+');
                switch (id.Length % 4)
                {
                    case 2: incoming += "=="; break;
                    case 3: incoming += "="; break;
                }

                var loginParamString = incoming.Decrypt();
                if (!string.IsNullOrEmpty(loginParamString))
                {
                    var loginParams = JObject.Parse(loginParamString);
                    if (!string.IsNullOrEmpty(loginParams["Command"].ToString()))
                    {
                        switch (loginParams["Command"].ToString())
                        {
                            case "ActivateAccount":
                                var uid = Convert.ToDecimal(loginParams["AccountId"].ToString());
                                var account = _accountService.FindById(uid);
                                if (account != null && account.Password.Decrypt() == loginParams["Password"].ToString())
                                {
                                    account.Active = true;
                                    account.Student.Active = true;
                                    account.Student.Person.Active = true;
                                    account.Student.Person.CitizenShips.ToList().ForEach(item => item.Active = true);
                                    _accountService.UpdatetItem(account);

                                    ViewBag.AccountActivated = true;
                                }
                                else
                                    ViewBag.WrongHash = true;
                                break;
                            case "ResetPassword":
                                var uidReset = Convert.ToDecimal(loginParams["AccountId"].ToString());
                                var accountReset = _accountService.FindById(uidReset);
                                if (accountReset != null
                                    && !string.IsNullOrEmpty(accountReset.ResetPasswordToken)
                                    && accountReset.ResetPasswordTokenExpire > DateTime.Now
                                    && accountReset.ResetPasswordToken == loginParams["Token"].ToString())
                                {
                                    accountReset.ResetPasswordToken = null;
                                    accountReset.ResetPasswordTokenExpire = null;
                                    _accountService.UpdatetItem(accountReset);

                                    Session["UserInfo"] = new UserViewModel
                                    {
                                        Username = accountReset.Email,
                                        Id = accountReset.Id,
                                        FirstName = accountReset.Student.Person.FirstName,
                                        LastName = accountReset.Student.Person.LastName,
                                        AccountEmail = accountReset.Email,
                                        AccountMobile = accountReset.Mobile,
                                        AccountMobileCode = "98"
                                    };

                                    return Redirect(string.Format("{0}://{1}{2}", Request.Url.Scheme, Request.Url.Authority, Url.Content("~")) + RouteData.Values["lang"] + "/Account/ResetPassword");
                                }
                                break;
                            default:
                                ViewBag.WrongHash = true;
                                break;
                        }
                    }
                    else
                        ViewBag.WrongHash = true;
                }
                else
                    ViewBag.WrongHash = true;
            }

            ViewBag.CountryList = new SelectList(_countryService.FetchAll().OrderBy(o => o.Name), "Id", "DisplayName");
            return View();
        }

