        [HttpPost]
        public JsonResult ChangeLanguage(string lang, string currentUrl)
        {
            //System.Threading.Thread.CurrentThread.CurrentCulture = new System.Globalization.CultureInfo(lang);
            //System.Threading.Thread.CurrentThread.CurrentUICulture = new System.Globalization.CultureInfo(lang);
            Session["Culture"] = lang;
            Session["lang"] = lang.Split(new char[] { '-' })[0];
            var newURL = string.Format("{0}://{1}{2}", Request.Url.Scheme, Request.Url.Authority, Url.Content("~")) + Session["lang"];
            var currentUrlSplited = currentUrl.Split('/').SkipWhile(x => x == "").ToArray();
            if (currentUrl != "/" && currentUrlSplited.Length > 0 && currentUrlSplited[0].Length == 2)
            {
                newURL += currentUrl.Remove(0, 3);
            }

            return new JsonResult
            {
                Data = new
                {
                    NewURL = newURL
                }
            };
        }



        [HttpPost]
        public JsonResult PasswordRecoveryRequest(string email = null)
        {
            var res = new JsonResult();
            if (!string.IsNullOrEmpty(email))
            {
                var isValid = true;
                try
                {
                    var addr = new System.Net.Mail.MailAddress(email);
                    isValid = true;
                }
                catch (Exception ex)
                {
                    isValid = false;
                }
                if (isValid)
                {
                    var account = _accountService.FindOne(w => w.Email == email);
                    if (account != null)
                    {
                        var token = Helpers.CreateMD5(DateTime.Now.Ticks.ToString());
                        account.ResetPasswordToken = token;
                        account.ResetPasswordTokenExpire = DateTime.Now.AddHours(1);
                        _accountService.UpdatetItem(account);

                        var validationUrl = HttpContext.Request.Url.GetLeftPart(UriPartial.Authority) + "/"
                                + RouteData.Values["lang"] + "/Account/Index/" + (JObject.FromObject(
                                new
                                {
                                    Command = "ResetPassword",
                                    AccountId = account.Id,
                                    Token = token
                                }
                                ).ToString().Encrypt().TrimEnd(padding).Replace('+', '-').Replace('/', '_'));
                        var validationHTML = "<a href=\"" + validationUrl + "\">" + validationUrl + "</a>";
                        var emailPasswordRecovery = new StringBuilder();
                        Helpers.SendEmail(email, Resources.Resources.PasswordRecovery,
                            emailPasswordRecovery.AppendFormat(Resources.Resources.PasswordRecovery_EmailBody, validationHTML, Resources.Resources.LANGUAGE_DIRECTION).ToString());
                        res = new JsonResult
                        {
                            Data = new
                            {
                                Result = true
                                    ,
                                Message = Resources.Resources.PasswordRecovery_Sent
                            }
                        };
                    }
                    else
                    {
                        res = new JsonResult
                        {
                            Data = new
                            {
                                Result = false
                                    ,
                                Message = Resources.Resources.PasswordRecovery_NotFound
                            }
                        };
                    }
                }
                else
                {
                    res = new JsonResult
                    {
                        Data = new
                        {
                            Result = false
                                    ,
                            Message = Resources.Resources.InvalidEmail
                        }
                    };
                }
            }
            else
            {
                res = new JsonResult
                {
                    Data = new
                    {
                        Result = false
                                    ,
                        Message = Resources.Resources.FillEmail
                    }
                };
            }
            return res;
        }

        [HttpPost]
        public JsonResult PasswordResetRequest(string password, string passwordRepeat)
        {
            var res = new JsonResult();
            if (Session["UserInfo"] != null)
            {
                if (password == passwordRepeat)
                {
                    var user = (UserViewModel)Session["UserInfo"];
                    var acc = _accountService.FindById(user.Id);
                    var encPass = password.Encrypt();
                    acc.Password = encPass;
                    _accountService.UpdatetItem(acc);
                    res = new JsonResult
                    {
                        Data = new
                        {
                            Result = true
                                    ,
                            Message = Resources.Resources.PasswordReset_Success
                        }
                    };
                }
                else
                {
                    res = new JsonResult
                    {
                        Data = new
                        {
                            Result = false
                                    ,
                            Message = Resources.Resources.PasswordReset_NotMatch
                        }
                    };
                }
            }
            else
            {
                res = new JsonResult
                {
                    Data = new
                    {
                        Result = false
                                    ,
                        Message = string.Empty
                    }
                };
            }
            return res;
        }


