            var res = new JsonResult();
            if (!string.IsNullOrEmpty(username) && !string.IsNullOrEmpty(password))
            {
                try
                {
                    var encPass = password.Encrypt();

                    var user = _userService.FindOne(w => w.Username == username); //&& w.Password == encPass
                    if (user != null && user.Password.Decrypt() == password)
                    //if (user != null && user.Password == password)
                    {
                        if (user.Active.Value)
                        {
                            var userRoles = _userRoleService.FetchMany(m => m.UserId == user.Id);                         
                            List<string> RolesList=null;
                            if (userRoles.Count() > 0)
