                                RolesList = (from ur in userRoles
                                             join u in _userService.FetchAll() on ur.UserId equals u.Id
                                             join r in _roleService.FetchAll() on ur.RoleId equals r.Id
                                             //join ac in _userAccessService.FetchAll() on r.Id equals ac.RoleId //into tempAccess
                                             //from t in tempAccess.DefaultIfEmpty()
                                             where ur.UserId == user.Id
                                             select ur.RoleId.ToString()
                                        ).ToList();
                            }


                            Session["UserCmsInfo"] = new UserLoginCmsViewModel
                            {
                                UserId = user.Id,
                                Username = user.Username,
                                UserRoles = RolesList != null && RolesList.Count() > 0 ? string.Join(",", RolesList) : ""
                                //Password=user.Password
                            };
                            //Session["lang"] = RouteData.Values["lang"];
                            res = new JsonResult
                            {
                                Data = new
                                {
                                    LoginResult = true,
                                    Message = "Welcome dear!"
                                }
                            };
                        }
                        else
                        {
                            res = new JsonResult
                            {
                                Data = new
                                {
                                    LoginResult = false,
                                    Message = Resources.Resources.Account_Deactive
                                }
                            };
                        }
                    }
                    else
                    {
                        res = new JsonResult
                        {
                            Data = new
                            {
                                LoginResult = false,
                                Message = Resources.Resources.Invalid_Login
                            }
                        };
                    }
                }
                catch (Exception ex)
                {
                    res = new JsonResult
                    {
                        Data = new
                        {
                            LoginResult = false,
                            Message = Resources.Resources.Critical_Error
                        }
                    };
                }
            }
            else
            {
                res = new JsonResult
                {
                    Data = new
